import React from 'react';
import { Menu, Row, Col } from 'antd';            // https://ant.design/components/menu/
import styled from 'styled-components';

const Bar = styled.div`
    width: 100%;
    height: '75px';
    background: #FA5A5A;  /* fallback for old browsers */
    background: -webkit-linear-gradient(to right, #f80759, #FA5A5A);  /* Chrome 10-25, Safari 5.1-6 */
    background: linear-gradient(to right, #f80759, #FA5A5A); /* W3C, IE 10+/ Edge, Firefox 16+, Chrome 26+, Opera 12+, Safari 7+ */
`

const MenuBar = () => {
    return (
        <Bar style={{color: 'white'}}>
            <nav style={{float: "right", marginTop: 20}}>
                <text style={{marginRight: '10vh'}}><a href="#home">HOME</a></text>
                <text style={{marginRight: '10vh'}}><a href="#about">ABOUT</a></text>
                <text style={{marginRight: '10vh'}}><a href="#charactor">CHARACTOR</a></text>
                <text style={{marginRight: '10vh'}}><a href="#help">HELP</a></text>
            </nav>
        </Bar>
    );
};

export default MenuBar;
